    Axios.get("http://localhost:9000/api/get").then((Response) => {
      setPortfolio(Response.data)
    });
  });
    return (
        <div className="container">
            <div className="py-4">
                <h1>Portfolios</h1>
            </div>
        </div>
    )
}
export default Portfolio;
